// SPDX-License-Identifier: MIT

pragma solidity ^0.8;

//import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract NRGToken{
  address private owner;
  string public name = 'NRGToken';
  string public symbol = 'NRG';
  uint256 public totalSupply = 1000000000000000000;
  uint8 public decimals = 18;

  event Transfer(
    address indexed _from,
    address indexed _to,
    uint _value
  );

  event Approve(
    address indexed _owner,
    address indexed _spender,
    uint _value
  );

  event SupplyChanged(uint256 newTotalSupply);

  mapping(address => uint256) public balanceOf;
  mapping(address => mapping(address => uint256)) public allowance;

  constructor(){
    owner = msg.sender;
    balanceOf[msg.sender] = totalSupply;
  }

  function transfer(address _to, uint256 _value) public returns (bool success){
    require(balanceOf[msg.sender] >= _value);
    balanceOf[msg.sender] -= _value;
    balanceOf[_to] += _value;
    emit Transfer(msg.sender, _to, _value);
    return true;
  }

  function transferFrom(address _from, address _to, uint256 _value) public returns (bool success){
    require(balanceOf[_from] >= _value);
    balanceOf[_from] -= _value;
    balanceOf[_to] += _value;
    emit Transfer(_from, _to, _value);
    return true;
  }

  function getBalance(address addr) public view returns(uint256){
    return balanceOf[addr];
  }

  // Increase the total supply of the token
  function mint(address _to, uint256 _value) public {
      require(msg.sender == owner, "Only the owner can mint tokens.");
      totalSupply += _value;
      balanceOf[_to] += _value;
      emit SupplyChanged(totalSupply);
  }

  // Decrease the total supply of the token
  function burn(address _to, uint256 _value) public {
      require(msg.sender == owner && balanceOf[_to] >= _value && _value > 0, "Insufficient balance.");
      totalSupply -= _value;
      balanceOf[_to] -= _value;
      emit SupplyChanged(totalSupply);
  }


  function exchangeETHForTokens(address _from, address _to, uint256 _value) public payable {
    uint256 token_amount = calculateTokenAmount(msg.value);
    // Check that the caller has enough ETH to exchange
    require(msg.value >= _value, "Insufficient ETH balance.");
    // Check that the contract has enough tokens to exchange
    require(balanceOf[_to] >= _value, "Insufficient token balance.");
    // Transfer the ETH to the recipient
    //msg.sender.transfer(msg.value);
    // Transfer the tokens to the recipient
    transferFrom(_to, _from, _value);
  }

  function calculateTokenAmount(uint256 ethAmount) public returns(uint256){
    // Look up the current exchange rate
    //int256 exchangeRate = getExchangeRate();
    // Calculate the amount of tokens the user will receive
    uint256 tokenAmount = ethAmount * 9;
    // Return the amount of tokens
    return tokenAmount;
  }

  function getExchangeRate() public returns(uint256){
    return 78;
  }




}
